Example for using a simple icon from the pebble icon set:

    <pebble-icon icon="create"></iron-icon>


See [pebble-icon](#pebble-icon) for more information about working with icons.

See [pebble-iconset](#pebble-iconset) and [pebble-iconset-svg](#pebble-iconset-svg) for more information about how to create a custom icon set.
